import Form from './components/Form/Form';


function Auth() {
  return (
    <div className='Auth'>
      <Form />
    </div>
  )
}


const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Page1/>} />
        <Route path="/page2" element={<Page2/>} />
        <Route path="/page3" element={<Page3/>} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
